import { useRef } from "react";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Services from "./pages/Services";

function App() {
  const homeRef = useRef(null);
  const servicesRef = useRef(null);

  return (
    <>
      <Navbar
        homeRef={homeRef}
        servicesRef={servicesRef}
      />

      <div ref={homeRef}>
        <Home />
      </div>

      <div ref={servicesRef}>
        <Services />
      </div>
    </>
  );
}

export default App;
